import React from "react";
import SideBarDD from "../SideBarD";
import WelcomeBar from "../WelcomeBar";
import { SideBarContainer, ContentContainer } from "./DashElements";

const Dash = () => {
  return (
    <>
      <SideBarContainer>
        <SideBarDD></SideBarDD>
      </SideBarContainer>
      <ContentContainer>
        <WelcomeBar></WelcomeBar>
      </ContentContainer>
    </>
  );
};

export default Dash;
